import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Header } from './'
import './App.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' element={<Header/>}></Route>
      </Routes>
    </Router>
  );
}

export default App;
